package Day1;

public class PreeFixPostFix {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int a = 10, b = 9;

		int d = ++a;
		int e = b++;

		System.out.println("value after prefix inrement " + d);
		System.out.println("value after postfix increment :" + e);

	}

}
